import React, { useState } from 'react';
import './Navbar.css';

const Navbar = () => {
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);

  const toggleMobileMenu = () => {
    setIsMobileMenuOpen(!isMobileMenuOpen);
  };

  return (
    <nav className="navbar">
      {/* Top Orange Bar */}
      <div className="top-bar">
        <div className="top-bar-container">
          <div className="top-bar-links">
            <a href="#students" className="top-link">STUDENTS</a>
            <span className="separator">|</span>
            <a href="#faculty" className="top-link">FACULTY & STAFF</a>
            <span className="separator">|</span>
            <a href="#about" className="top-link">ABOUT US</a>
            <span className="separator">|</span>
            <a href="#contact" className="top-link">CONTACT US</a>
          </div>
        </div>
      </div>

      {/* Main Green Navigation Bar */}
      <div className="main-nav">
        <div className="nav-container">
          {/* Logo and Brand */}
          <div className="brand">
            <div className="logo">
              <div className="logo-circle">
                <div className="logo-text">CITY COLLEGE OF BAYAWAN</div>
                <div className="logo-graphics">
                  <div className="logo-terraces"></div>
                  <div className="logo-gear"></div>
                </div>
              </div>
            </div>
            <div className="brand-text">
              <h1>CITY COLLEGE</h1>
              <h2>OF BAYAWAN</h2>
            </div>
          </div>

          {/* Mobile Menu Button */}
          <button className="mobile-menu-btn" onClick={toggleMobileMenu}>
            <span></span>
            <span></span>
            <span></span>
          </button>

          {/* Navigation Links */}
          <div className={`nav-links ${isMobileMenuOpen ? 'mobile-open' : ''}`}>
            <a href="home" className="nav-link home-btn">HOME PAGE</a>
            <a href="academics" className="nav-link">ACADEMIC PROGRAMS</a>
            <a href="admissions" className="nav-link">ADMISSIONS</a>
            <a href="news" className="nav-link">NEWS & EVENTS</a>
            <a href="downloads" className="nav-link">DOWNLOADS</a>
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
